goed

met Cedric the Entertainer, Lucy Liu en Nicollette Sheridan

Jake is een congierge die vanwege geheugenverlies denkt dat hij iemand anders is. Een mysterieuze femme fatale maakt hier dankbaar gebruik van door hem te laten geloven dat hij een undercover agent is. Ze stuurt hem achter wapensmokkelaars aan, waarbij zowel de CIA als de FBI betrokken blijkt. De mysterieuze vrouw blijkt kwade bedoelingen te hebben, terwijl een collega agente verliefd op hem wordt. Hij moet zijn hoofd koel houden bij deze knappe vrouwen terwijl hij met een levensgevaarlijke missie bezig is:
